var undertale=Elm.UndertaleDialog.fullscreen({staticRoot:$STATIC_ROOT,scriptRoot:$SCRIPT_ROOT});undertale.ports.focus.subscribe(function(params){setTimeout(function(){var elem=document.getElementById(params.elementId);if(elem){elem.focus();if(params.moveCursorToEnd){var val=elem.value;elem.value='';elem.value=val;}}},50);});undertale.ports.getImg.subscribe(function(svgId){setTimeout(function(){var mySVG=document.getElementById(svgId);svgAsPngUri(mySVG,{},function(uri){undertale.ports.getRenderData.send(uri);});},50);});